export function Create() {
    return (
        <>
            <h1 style={{color: orange}}>Introduction</h1>
            <p>Welcome to the FaithTech Workbook! This guide is designed to help you building technology using the redemptive framework outlined in the FaithTech Playbook. Whether you're looking to glorify God by solving real-world problems as part of a FaithTech community, another community of Christ-followers, or just a couple of friends - this guide is for you!</p>
            <img src="network.jpeg" loading="lazy" alt=""></img>
            <h2>How to Use This Workbook</h2>
            <p>Each section of this workbook corresponds to a stage in the 4D Cycle. Work through each section in order, completing the exercises and reflecting on the questions provided. Feel free to revisit sections as needed and adapt the exercises to your specific context.</p>
            <p>image here with arrows</p>
            <p>As you progress through the workbook, remember that practicing redemptive technology is an ongoing journey. Continue to apply these principles in your work, always seeking to build technology that helps humanity become persons who love God and love others more deeply. Let's begin our journey towards redemptive technology!</p>
        </>
    )
}
